const videos = [
    {
        name: 'Cheburek',
        duration: 12,
        id: 1
    },
    {
        name: 'Lol',
        duration: 13,
        id: 2
    },
    {
        name: 'Kek',
        duration: 10,
        id: 3
    }
]

export function VideoList() {
    return (
        <>
            <h1>Video List</h1>
            {
                videos.map((video)=>{
                    return(
                        <div key={video.id}>
                            <p>{video.name}</p>
                            <p>{video.duration}</p>
                            <button>Like!</button>
                        </div>
                    )
                })
            }
        </>
    )
}
